import React from 'react';
import SearchBar from './SearchBar';
import { isCompositeComponent } from 'react-dom/test-utils';

class App extends React.Component {
    onSearchSubmit(term) {
        console.log(term);
    }

    render() {
        return (
            <div className="ui container" style={{ marginTop: 'l0px' }}>
                <SearchBar />
            </div>
        );
    }
}

export default App;
